import React, { Component } from 'react'
import { DarkTheme, LightTheme } from './components/SettingsPanel';

export default class Button extends Component {


    constructor() {
       super();

       this.state = {
         clicked: false
       };

       this.handleClick = this.handleClick.bind(this);
     }

    handleClick() {
      this.setState({
        clicked: true
      });
    }

    render () {

      return (
      <div id="SignUpSignInDiv">


          <div onClick={this.handleClick}>

            {this.state.clicked ? <DarkTheme /> : <LightTheme />}

          <LightTheme />

          </div>

      </div>
    )



    }
  }
